using UnityEngine;
using System.Collections;
using System.Text;
using System.Collections.Generic;

public class Vision : MonoBehaviour
{
	void Start()
    {
        string url = "https://vision.googleapis.com/v1/images:annotate?key=AIzaSyDNiOUrvRHj0anRBsC1NrrU7v8wwA90v8E";
        string testImage = "";
        string json = "{\"requests\": [ { \"image\" : {\"content\":\"" + testImage + "},\"features\":[{\"type\":\"LABEL_DETECTION\",\"maxResults\":10}]}]}";
        Dictionary<string, string> headers = new Dictionary<string, string>();
        headers.Add("Content-Type", "application/json");
        WWW www = new WWW(url, Encoding.ASCII.GetBytes(json.ToCharArray()), headers);
        StartCoroutine(WaitForRequest(www));
    }

    public IEnumerator WaitForRequest(WWW www)
    {
        yield return www;

        if(www.error == null)
        {
            Debug.Log(www.text);
        }
        else
        {
            Debug.Log("Error: " + www.error);
        }
    }
}